{
  "title": "ApartmentDetails",
  "description": "This modern, designer-furnished 3-room apartment located on the 10th storey of the EUROPALACE building features views of the beautiful Little Fatra, Martinky, Dubeň, including Vlčince and the surrounding area thanks to its elevated position. The apartment is sensibly divided into a living (social) area and a space designated for relaxation or study. The total associated area is 94.93 m2, which consists of : entrance hallway / 6.82 m2 / with a built-in wardrobe measuring 3 meters, making storage in the apartment hassle-free, southeast-facing living room with kitchen / up to 25.56 m2 /, offering views of the Little Fatra and Martinky, providing beautiful vistas of the Žilina basin mountains. The living room is connected to the kitchen, aesthetically separated by a feature ceiling that also houses the lighting fixtures, t has access to a balcony that runs the entire width of the living room, the bedroom (18.9 m2) is furnished with a double bed, nightstands, and wardrobes, and boasts an ideal location that new owners will appreciate, especially in the summer months, as it is north-facing, preventing overheating and eliminating the need for a heating system. Additionally, there are two bathrooms, one of which has a separate shower room and another with a toilet. The apartment also features a large balcony overlooking the cityscape and a private parking space in the underground garage. The price of the property is 292000 € . Monthly management fees for the apartment: 215 € / month including security services. Parking: private parking space in the underground garage is not included in the price. The price of the premium parking space, where you can park both a car and a trailer or motorcycle, is available for an additional fee (the owner is currently preparing for an electric charging station)."
}

